    data: |
      SELECT DISTINCT - col0 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + 79 > NULL OR - - col2 <> ( col1 * - col1 );
  - name: tab1

outputs:
  - name: q4388.out
    data: |
      -51
      -85
      -91
